import React from 'react'
import {ReactComponent as Logo} from '../assets/Logo.svg'
import styled from 'styled-components'

const StyledFooter = styled.footer`
display: flexk;
background: #FF7878;
`

export function Footer() {
    return (
        <StyledFooter>
            <p>Copyright &copy; 2021 - </p>
            <Logo/>
        </StyledFooter>
    )
}
